import axios from "axios"

const fetchLogin = async () => {
    await axios.post("http://localhost:3001/login", {
            username: username,
            password: password,
        }).then((response) => {
            if (response.data.message) {
                console.log(response.data.message);
            } else {
                dispatch(setUser(response.data));
            }
        });
}
